//////////////////////////////////////////////////////
// Support Functions
//////////////////////////////////////////////////////


void printGiven(int *returnArray, int returnSize) {
#ifdef PRINT_GIVEN
    int i;

    printf("given: [ ");
    for (i=0; i<returnSize; i++) {
        printf("%d", returnArray[i]);
        if (i < (returnSize-1))
            printf(", ");
    }
    printf(" ]\n");
#endif
}

void testGiven(int *returnArray, int returnSize) {
    int i;
    int value;

    value = returnArray[0];
    for (i=1; i<returnSize; i++) {
        if (value > returnArray[i]) {
            printf("ERROR: at index %d\n", i);
            break;
        }
        value = returnArray[i];
    }

}

//////////////////////////////////////////////////////
// Question Functions
//////////////////////////////////////////////////////

void swap(int *a, int *b) {
    int temp;
    temp = *a;
    *a = *b;
    *b = temp;
}

int partition(int *nums, int low, int hi) {
    int i, j;
    int pivot = nums[hi];

    i = (low-1); // index of smaller
    for (j = low; j<=(hi-1); j++) {
        if (nums[j] <= pivot) {
            i++;
            swap(&(nums[i]), &(nums[j]));
        }
    }
    swap(&(nums[i+1]), &(nums[j]));
    return(i+1);
}

int sort(int* nums, int low, int hi){
    int p;

    if (low < hi) {
        p = partition(nums, low, hi);
        sort(nums, low, p-1);
        sort(nums, p+1, hi);
    }
    printGiven(nums, hi+1);
    return hi+1;
}

